			  F2, F3, F4, F5, F6);
d_field_Response_type(<<0:1, X:7, Rest/binary>>, N, Acc,
		      _, F2, F3, F4, F5, F6) ->
    <<Tmp:32/signed-native>> = <<(X bsl N +
				    Acc):32/unsigned-native>>,
    NewFValue = 'd_enum_Response.ResponseType'(Tmp),
    dfp_read_field_def_Response(Rest, 0, 0, NewFValue, F2,
				F3, F4, F5, F6).


