				    F2) ->
    'dg_read_field_def_Term.AssocPair'(Other, Z1, Z2, F1,
				       F2).

'dg_read_field_def_Term.AssocPair'(<<1:1, X:7,
				     Rest/binary>>,
				   N, Acc, F1, F2)
    when N < 32 - 7 ->
    'dg_read_field_def_Term.AssocPair'(Rest, N + 7,
				       X bsl N + Acc, F1, F2);
'dg_read_field_def_Term.AssocPair'(<<0:1, X:7,
				     Rest/binary>>,
				   N, Acc, F1, F2) ->
    Key = X bsl N + Acc,
    case Key of
      10 -> 'd_field_Term.AssocPair_key'(Rest, 0, 0, F1, F2);
      18 -> 'd_field_Term.AssocPair_val'(Rest, 0, 0, F1, F2);
      _ ->
	  case Key band 7 of
	    0 -> 'skip_varint_Term.AssocPair'(Rest, 0, 0, F1, F2);
	    1 -> 'skip_64_Term.AssocPair'(Rest, 0, 0, F1, F2);
	    2 ->
		'skip_length_delimited_Term.AssocPair'(Rest, 0, 0, F1,
						       F2);
	    5 -> 'skip_32_Term.AssocPair'(Rest, 0, 0, F1, F2)
	  end
    end;
'dg_read_field_def_Term.AssocPair'(<<>>, 0, 0, F1,
				   F2) ->
    #'Term.AssocPair'{key = F1, val = F2}.

