      18 -> d_field_Term_datum(Rest, 0, 0, F1, F2, F3, F4);
      26 -> d_field_Term_args(Rest, 0, 0, F1, F2, F3, F4);
      34 -> d_field_Term_optargs(Rest, 0, 0, F1, F2, F3, F4);
      _ ->
