merge_msgs(Prev, New)
    when element(1, Prev) =:= element(1, New) ->
    case Prev of
      #'VersionDummy'{} -> merge_msg_VersionDummy(Prev, New);
      #'Query.AssocPair'{} ->
	  'merge_msg_Query.AssocPair'(Prev, New);
      #'Query'{} -> merge_msg_Query(Prev, New);
      #'Frame'{} -> merge_msg_Frame(Prev, New);
      #'Backtrace'{} -> merge_msg_Backtrace(Prev, New);
      #'Response'{} -> merge_msg_Response(Prev, New);
      #'Datum.AssocPair'{} ->
	  'merge_msg_Datum.AssocPair'(Prev, New);
      #'Datum'{} -> merge_msg_Datum(Prev, New);
      #'Term.AssocPair'{} ->
	  'merge_msg_Term.AssocPair'(Prev, New);
      #'Term'{} -> merge_msg_Term(Prev, New)
    end.

merge_msg_VersionDummy(_Prev, New) -> New.

'merge_msg_Query.AssocPair'(#'Query.AssocPair'{key =
						   PFkey,
					       val = PFval},
			    #'Query.AssocPair'{key = NFkey, val = NFval}) ->
    #'Query.AssocPair'{key =
			   if NFkey =:= undefined -> PFkey;
			      true -> NFkey
			   end,
		       val = merge_msg_Term(PFval, NFval)}.

merge_msg_Query(#'Query'{type = PFtype, query = PFquery,
			 token = PFtoken,
			 'OBSOLETE_noreply' = PFOBSOLETE_noreply,
			 accepts_r_json = PFaccepts_r_json,
			 global_optargs = PFglobal_optargs},
		#'Query'{type = NFtype, query = NFquery,
			 token = NFtoken,
			 'OBSOLETE_noreply' = NFOBSOLETE_noreply,
			 accepts_r_json = NFaccepts_r_json,
			 global_optargs = NFglobal_optargs}) ->
    #'Query'{type =
		 if NFtype =:= undefined -> PFtype;
		    true -> NFtype
		 end,
	     query = merge_msg_Term(PFquery, NFquery),
	     token =
		 if NFtoken =:= undefined -> PFtoken;
		    true -> NFtoken
		 end,
	     'OBSOLETE_noreply' =
		 if NFOBSOLETE_noreply =:= undefined ->
			PFOBSOLETE_noreply;
		    true -> NFOBSOLETE_noreply
		 end,
	     accepts_r_json =
		 if NFaccepts_r_json =:= undefined -> PFaccepts_r_json;
		    true -> NFaccepts_r_json
		 end,
	     global_optargs = PFglobal_optargs ++ NFglobal_optargs}.

merge_msg_Frame(#'Frame'{type = PFtype, pos = PFpos,
			 opt = PFopt},
		#'Frame'{type = NFtype, pos = NFpos, opt = NFopt}) ->
    #'Frame'{type =
		 if NFtype =:= undefined -> PFtype;
		    true -> NFtype
		 end,
	     pos =
		 if NFpos =:= undefined -> PFpos;
		    true -> NFpos
		 end,
	     opt =
		 if NFopt =:= undefined -> PFopt;
		    true -> NFopt
		 end}.

merge_msg_Backtrace(Prev, undefined) -> Prev;
merge_msg_Backtrace(undefined, New) -> New;
merge_msg_Backtrace(#'Backtrace'{frames = PFframes},
		    #'Backtrace'{frames = NFframes}) ->
    #'Backtrace'{frames = PFframes ++ NFframes}.

merge_msg_Response(#'Response'{type = PFtype,
			       notes = PFnotes, token = PFtoken,
			       response = PFresponse, backtrace = PFbacktrace,
			       profile = PFprofile},
		   #'Response'{type = NFtype, notes = NFnotes,
			       token = NFtoken, response = NFresponse,
			       backtrace = NFbacktrace, profile = NFprofile}) ->
    #'Response'{type =
		    if NFtype =:= undefined -> PFtype;
		       true -> NFtype
		    end,
		notes = PFnotes ++ NFnotes,
		token =
		    if NFtoken =:= undefined -> PFtoken;
		       true -> NFtoken
		    end,
		response = PFresponse ++ NFresponse,
		backtrace =
		    merge_msg_Backtrace(PFbacktrace, NFbacktrace),
		profile = merge_msg_Datum(PFprofile, NFprofile)}.

