			  if NFkey =:= undefined -> PFkey;
			     true -> NFkey
			  end,
		      val = merge_msg_Term(PFval, NFval)}.

merge_msg_Term(Prev, undefined) -> Prev;
merge_msg_Term(undefined, New) -> New;
merge_msg_Term(#'Term'{type = PFtype, datum = PFdatum,
		       args = PFargs, optargs = PFoptargs},
	       #'Term'{type = NFtype, datum = NFdatum, args = NFargs,
		       optargs = NFoptargs}) ->
    #'Term'{type =
		if NFtype =:= undefined -> PFtype;
		   true -> NFtype
		end,
	    datum = merge_msg_Datum(PFdatum, NFdatum),
	    args = PFargs ++ NFargs,
	    optargs = PFoptargs ++ NFoptargs}.



verify_msg(Msg) ->
    case Msg of
      #'VersionDummy'{} ->
	  v_msg_VersionDummy(Msg, ['VersionDummy']);
      #'Query.AssocPair'{} ->
	  'v_msg_Query.AssocPair'(Msg, ['Query.AssocPair']);
      #'Query'{} -> v_msg_Query(Msg, ['Query']);
      #'Frame'{} -> v_msg_Frame(Msg, ['Frame']);
      #'Backtrace'{} -> v_msg_Backtrace(Msg, ['Backtrace']);
      #'Response'{} -> v_msg_Response(Msg, ['Response']);
      #'Datum.AssocPair'{} ->
	  'v_msg_Datum.AssocPair'(Msg, ['Datum.AssocPair']);
      #'Datum'{} -> v_msg_Datum(Msg, ['Datum']);
      #'Term.AssocPair'{} ->
	  'v_msg_Term.AssocPair'(Msg, ['Term.AssocPair']);
      #'Term'{} -> v_msg_Term(Msg, ['Term']);
      _ -> mk_type_error(not_a_known_message, Msg, [])
    end.


v_msg_VersionDummy(#'VersionDummy'{}, _Path) -> ok.

'v_msg_Query.AssocPair'(#'Query.AssocPair'{key = F1,
					   val = F2},
			Path) ->
    if F1 == undefined -> ok;
       true -> v_type_string(F1, [key | Path])
    end,
    if F2 == undefined -> ok;
       true -> v_msg_Term(F2, [val | Path])
    end,
    ok;
'v_msg_Query.AssocPair'(X, Path) ->
    mk_type_error({expected_msg, 'Query.AssocPair'}, X,
		  Path).

v_msg_Query(#'Query'{type = F1, query = F2, token = F3,
		     'OBSOLETE_noreply' = F4, accepts_r_json = F5,
		     global_optargs = F6},
	    Path) ->
    if F1 == undefined -> ok;
       true -> 'v_enum_Query.QueryType'(F1, [type | Path])
    end,
    if F2 == undefined -> ok;
       true -> v_msg_Term(F2, [query | Path])
    end,
    if F3 == undefined -> ok;
       true -> v_type_int64(F3, [token | Path])
    end,
    if F4 == undefined -> ok;
       true -> v_type_bool(F4, ['OBSOLETE_noreply' | Path])
    end,
    if F5 == undefined -> ok;
       true -> v_type_bool(F5, [accepts_r_json | Path])
    end,
    if is_list(F6) ->
	   ['v_msg_Query.AssocPair'(Elem, [global_optargs | Path])
	    || Elem <- F6];
       true ->
	   mk_type_error({invalid_list_of,
			  {msg, 'Query.AssocPair'}},
			 F6, Path)
    end,
    ok.

v_msg_Frame(#'Frame'{type = F1, pos = F2, opt = F3},
	    Path) ->
    if F1 == undefined -> ok;
       true -> 'v_enum_Frame.FrameType'(F1, [type | Path])
    end,
    if F2 == undefined -> ok;
       true -> v_type_int64(F2, [pos | Path])
    end,
    if F3 == undefined -> ok;
       true -> v_type_string(F3, [opt | Path])
    end,
    ok;
v_msg_Frame(X, Path) ->
    mk_type_error({expected_msg, 'Frame'}, X, Path).

v_msg_Backtrace(#'Backtrace'{frames = F1}, Path) ->
    if is_list(F1) ->
	   [v_msg_Frame(Elem, [frames | Path]) || Elem <- F1];
       true ->
	   mk_type_error({invalid_list_of, {msg, 'Frame'}}, F1,
			 Path)
